class Solution(object):
    def jump(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        if len(nums) == 1:
            return 0

        max_reach = nums[0]
        jumps = 1
        cur_reach = nums[0]

        for i in range(1, len(nums)):
            if i == len(nums) - 1:
                return jumps

            if i > cur_reach:
                jumps += 1
                cur_reach = max_reach

            max_reach = max(max_reach, i + nums[i])

        return jumps

