class Solution(object):
    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: int
        """

        # 1. count the number of each letter
        # 2. if the number is odd, add 1 to the result
        # 3. if the number is even, add it to the result
        # 4. return the result

        # 1.
        letter_dict = {}
        for letter in s:
            if letter not in letter_dict:
                letter_dict[letter] = 1
            else:
                letter_dict[letter] += 1

        # 2.
        result = 0
        for letter in letter_dict.values():
            if letter % 2 == 1:
                result += 1

        # 3.
        if result < len(s):
            result += 1

        # 4.
        return result

