class Solution(object):
    def minCut(self, s):
        """
        :type s: str
        :rtype: int
        """

        n = len(s)
        dp = [n-i-1 for i in range(n)]

        for i in range(n-2, -1, -1):
            for j in range(i+1, n):
                if s[i] == s[j] and (dp[j+1] == j+1 or dp[j+1] == j+1-dp[j]):
                    dp[i] = j+1
                else:
                    dp[i] = min(dp[i], dp[j+1]+1)

        return dp[0]

