class Solution(object):
    def minPatches(self, nums, n):
        """
        :type nums: List[int]
        :type n: int
        :rtype: int
        """

        # edge case
        if not nums:
            return 0

        # initialize
        patches = 0
        nums_sum = 0

        # iterate
        for num in nums:
            if num <= n:
                nums_sum += num
            else:
                patches += 1
                if nums_sum >= n:
                    break
                else:
                    nums_sum += nums_sum + num

        # edge case
        if nums_sum < n:
            patches += 1

        return patches

