        """
        :type heights: List[int]
        :rtype: int
        """

        stack = [-1]
        max_area = 0

        for i, height in enumerate(heights):
            while heights[stack[-1]] > height:
                max_area = max(max_area, (i - stack.pop() - 1) * heights[stack[-1]])
            stack.append(i)

        return max_area

