        """
        :type n: int
        :rtype: int
        """

        def backtrack(row, cols, pie, na):
            if row == n:
                return 1

            count = 0
            for col in range(n):
                if col not in cols and row + col not in pie and row - col not in na:
                    count += backtrack(row + 1, cols | {col}, pie | {row + col}, na | {row - col})
            return count

        return backtrack(0, set(), set(), set())

